import React, { useEffect, useState } from 'react';
import InputBox from '../../components/inputbox/InputBox';
import { sendGet, URL } from '../../util/util';



const Home = () => {
    const [list, setList] = useState([])

    function showConsole(data)
    {
        console.log(data);
        setList(data);
    }

    useEffect(()=>{

        sendGet(URL+"/ppMain",showConsole)
    },[])
    return (
        <div>
            <p>{list.length > 0 && list[0].brand_name}</p>
            <div className=''>
                <img src="" alt="팀로고" />
                <InputBox></InputBox>
            </div>
        </div>
    );
};

export default Home;
